IF OBJECT_ID('dbo.proc_transform_393', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_393;
GO
CREATE PROCEDURE dbo.proc_transform_393
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_393
    SET payload = LEFT(payload, 1000) + N'|V4-393|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_393;
END
